
import 'package:flutter/material.dart';
import 'dart:convert';
import 'package:http/http.dart' as http;
import 'dart:convert';


class TestView extends StatefulWidget {
  @override
  State<TestView> createState() => _TestViewState();
}

class _TestViewState extends State<TestView> {
  List<String> resultList = [];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
        appBar: AppBar(title: Center(child: Text('Qookit Test Page'))),
        body: Column(
          children: [
            ElevatedButton(
              onPressed: () async {
                // Add your button's onPressed logic here
                print('Button Pressed');
                List<String> parsedText = await sendOCRRequest(getBase64EncodedImage());
                List<String> newData = await pruneIngredientList(parsedText);
                print(newData);
                resultList=newData;
                setState(() {
                });
              },
              child: Text('Press Me'),
            ),
            Expanded(
              child: ListView.builder(
                itemBuilder: (context, index) {
                  return ListTile(
                    title: Text(resultList[index]),
                  );
                },
                itemCount: resultList.length,
              ),
            ),
          ],
        )
    );
  }

  Future<List<String>> pruneIngredientList(List<String> parsedText) async {
    List<String> filteredList = [];

    // Regular expression to match strings with alphabets only
    final ingredientRegex = RegExp(r'^[a-zA-Z\s]+$');

    // Iterate through each element in the parsedTextList
    for (var parsedText in parsedText[0].split('\r\n')) {

      if(parsedText.contains('TOTAL') || parsedText.contains('TAX') || parsedText.contains('DEBIT')) {
        continue;
      }

      // Check if the parsedText matches the alphabetRegex
      if (ingredientRegex.hasMatch(parsedText)) {
        // Add the parsedText to the filteredList
        filteredList.add(parsedText);
      }
    }


    return filteredList;
  }

  Future<List<String>> sendOCRRequest(String base64Image) async {
    List<String> parsedTextList = [];

    var url = Uri.parse('https://api.ocr.space/parse/image');
    var apiKey = 'K89478254888957';
    var language = 'eng';
    var isOverlayRequired = 'false';

    var headers = {'apikey': apiKey};
    var request = http.MultipartRequest('POST', url);

    request.headers.addAll(headers);
    request.fields['base64Image'] = 'data:image/jpeg;base64,$base64Image';
    request.fields['language'] = language;
    request.fields['isOverlayRequired'] = isOverlayRequired;

    try {
      var response = await request.send();
      if (response.statusCode == 200) {
        var responseString = await response.stream.bytesToString();
        var jsonResponse = jsonDecode(responseString);
        // Check if the response contains the "ParsedResults" key
        if (jsonResponse.containsKey('ParsedResults')) {
          // Access the "ParsedResults" list
          var parsedResults = jsonResponse['ParsedResults'];

          // Iterate through each item in the "ParsedResults" list
          for (var parsedResult in parsedResults) {
            // Check if the parsedResult contains the "ParsedText" key
            if (parsedResult.containsKey('ParsedText')) {
              // Extract the "ParsedText" value and add it to the list
              var parsedText = parsedResult['ParsedText'];
              parsedTextList.add(parsedText);
            }
          }
        }
      } else {
        print('Request failed with status: ${response.statusCode}.');
      }
    } catch (e) {
      print('Error: $e');
    }

    return parsedTextList;
  }

  String getBase64EncodedImage() {
    return ''; // Replace this with the actual Base64 image data
  }

}




